// variables global
var myMap;
var api = "0XUH5ZVKMA8NIJ2J";
var chart, interval, url, timePeriod, breaker;
var firstTimeCallingMyFunction = false;

function chartIt(str) {

	document.getElementById("tablinks_daily").setAttribute("style", "background-color: inherit");
	document.getElementById("tablinks_weekly").setAttribute("style", "background-color: inherit");
	document.getElementById("tablinks_monthly").setAttribute("style", "background-color: inherit");

	myMap = new Map();

	if (str == null) {
		timePeriod = "TIME_SERIES_DAILY";
		breaker = "Time Series (Daily)";
		document.getElementById("tablinks_daily").setAttribute("style", "background-color: #ccc");
	} else if (str == 'Weekly') {
		timePeriod = "TIME_SERIES_WEEKLY";
		breaker = "Weekly Time Series";
		document.getElementById("tablinks_weekly").setAttribute("style", "background-color: #ccc");
	} else if (str == 'Monthly') {
		timePeriod = "TIME_SERIES_MONTHLY";
		breaker = "Monthly Time Series";
		document.getElementById("tablinks_monthly").setAttribute("style", "background-color: #ccc");
	} else {
		alert ('Invalid Choice!');
		return;
	}

	var symbol = document.getElementById("numb").value;

	//search and replace replace symbol with company name
	var found = false;
	var companyName;
	for (d in data) {
		if (symbol == data[d]["symbol"]) {
			found = true;
			companyName = data[d]["company"];
		}
	}

	if (!found) {
		alert (symbol + ' is not listed on NASDAQ Stock Exchange!');
		return;
	}

	url = "https://www.alphavantage.co/query?function=" + timePeriod + "&symbol="
		+ symbol + "&apikey=" + api; 

	console.log(url);

	fetch(url, {method: 'get'
	}).then(function(response) {
		
		// Examine the text in the response
	  	response.json().then(function(data) {
	    //document.getElementById("demo").innerHTML = JSON.stringify(data);

	        var str = JSON.stringify(data);
	        var obj = JSON.parse(str);

			var dailys = obj[breaker];

			for(var prop in dailys) {
				var keyString = prop;
				var data = dailys[prop]["4. close"];

				myMap.set(keyString, data);
				//console.log("Key " + keyString + " data " + data);
			}

			chart = new CanvasJS.Chart("chartContainer", {
				animationEnabled: true,
				title:{
					text: companyName,
					fontColor: "orange"
				},
				axisX:{
					title : "Date",
					titleFontColor: "black",
					valueFormatString: formatDate(str)
				},
				axisY: {
					title: "Stock Price",
					titleFontColor: "black",
					includeZero: false,
					scaleBreaks: {
						autoCalculate: true
					}
				},
				data: [{
					type: "line",
					xValueFormatString: formatDateChart(str),
					color: "green",
					dataPoints: dataPoints(myMap)
				}]
			});
		
			// chart.render();	
		});
	}).catch(function(err) {
		alert('Error occured. Restart the page.');
	});

	document.getElementById('chartContainer').setAttribute("style", "height:55vh");
	document.getElementsByTagName('body')[0].setAttribute("style", "height:88vh");
	//document.getElementsByTagName('footer')[0].setAttribute("style", "bottom:0; right:0; padding: 15px");

	myFunction();
	interval = setInterval(myFunction, 120000);
}

function dataPoints(myMap) {

	var array = [];
	var i = 0, j = 10;
	for (var [key, value] of myMap) {
		var keyDate = key.split("-");
		var month = parseInt(keyDate[1]) - 1;

		//year-month-date and price (int)
		array.push ({x : new Date(keyDate[0], month.toString(), keyDate[2]),
					y : parseFloat(value)});
		//console.log(keyDate[0] + value);
	}
	return array;
}

function formatDate(str) {
	if (str == null) {
		return "DD MMM"
	} 
	return "MMM YYYY"
}

function formatDateChart(str) {
	if (str == null) {
		return "DD MMM"
	} 
	return "DD MM YYYY"
}

function myFunction() {

	console.log("Fetching...");

	// Get the value of the input field with id="numb"
	symbol = document.getElementById("numb").value;

	url = "https://www.alphavantage.co/query?function=" + timePeriod + "&symbol="
		+ symbol + "&apikey=" + api; 

	fetch(url, {method: 'get'
	}).then(function(response) {
		// Examine the text in the response
	  response.json().then(function(data) {
	    //document.getElementById("demo").innerHTML = JSON.stringify(data);

	    var str = JSON.stringify(data);
	    var obj = JSON.parse(str);

	    //"2017-11-03 13:07:00" or "2017-11-03"
	    if (hasWhiteSpace(obj["Meta Data"]["3. Last Refreshed"])) {
	    	var time = obj["Meta Data"]["3. Last Refreshed"].split(" ")[0];	
	    } else {
	        var time = obj["Meta Data"]["3. Last Refreshed"];
	    }

	    /* {
	        	"1. open": "1022.1100", 
	        	"2. high": "1028.3800", 	
	    		"3. low": "1020.3100", 
	        	"4. close": "1028.1900",
	            "5. volume": "266535"
	    	} */
	    var timeNowObj = obj[breaker][time];

	    //"1028.1900"
	    var stockNow = parseFloat(timeNowObj["4. close"]);

	    var prevStock = parseFloat(chart.options.data[0].dataPoints[1].y);

 	    var percChange, difference, percColor;
	    if (!firstTimeCallingMyFunction) {
			var img = document.createElement("img");
			img.setAttribute("id", "imggif");
		    var src = document.getElementById("updown");
			src.appendChild(img);
			firstTimeCallingMyFunction = true;
		} else {			
			var img = document.getElementById("imggif")
			var src = document.getElementById("updown");
			src.removeChild(img);
			var img = document.createElement("img");
			img.setAttribute("id", "imggif");
			src.appendChild(img);		
		}

	    if (prevStock > stockNow) {
			img.src = "down.gif";
			var difference = prevStock - stockNow;
			percChange = difference/prevStock;
			percColor = "Red";
	    } else if (prevStock < stockNow) {
	    	img.src = "up.gif";
	    	var difference = stockNow - prevStock;
	    	percChange = difference/prevStock;
	    	percColor = "Green";
	    } else {

	    }

		var datefull = chart.options.data[0].dataPoints[0].x;

		document.getElementById("curStock").innerHTML = stockNow.toFixed(2);
		document.getElementById('curStock').setAttribute("style", "display: inline");

		document.getElementById('updown').setAttribute("style", "display: inline; color: white");

		document.getElementById("status").innerHTML = "NASDAQ: " + symbol + " - " + datefull + "</br>";
		document.getElementById('status').setAttribute("style", "display: inline; color: white");

		document.getElementById("perc").innerHTML = difference.toFixed(2) + " (" + (percChange * 100).toFixed(2) + "%)";
		document.getElementById('perc').setAttribute("style", "display: inline; font-weight: bolder; color: "+percColor);

	    //latest entry
	    //chart.options.data[0].dataPoints[0].y = 0;
	    console.log("New Point: " + chart.options.data[0].dataPoints[0].y);
		chart.render();
	  });
	}).catch(function(err) {
		alert('Error occured. Restart the page.');
	});

	console.log("Next fetch in " + Math.floor(120000 / 60000) + " minutes...");
}

function hasWhiteSpace(s) {
	return s.indexOf(' ') >= 0;
}

function stopFunc() {
	console.log("Stopped fetching...");
	clearInterval(interval);
}

